import React, { useState, useEffect, useMemo } from "react";
import "./FoodQR.css";
import { Link } from "react-router-dom";

function NavbarBG() {
  return <div id="navbarbg"></div>;
}

function NavbarItems2() {
  return (
    <div id="NI2">
      <h1 id="hr">HOSTEL RESIDENT</h1>
      <a href="#" id="h">
        Home
      </a>
      <Link to="/" id="mealselect">
        Meal Selection
      </Link>
      <a href="#" id="com">
        Complaints
      </a>
      <a href="#" id="pro">
        Profile
      </a>
      <a href="#" id="log">
        Logout
      </a>
    </div>
  );
}

function FoodQR() {
  return (
    <div id="container">
      <NavbarBG />
      <NavbarItems2 />
    </div>
  );
}
export default FoodQR;
